import React, { Component } from 'react'
import ExportView from './exportView';
import ModifierView from './ModifierView'
class Background extends Component {
    render() {
      return (
        <div className='background'>
          <ExportView/>
          <ModifierView/>
        </div>
      )
    }
  }

export default Background;
